bioghist.p:
Het OM is de organisatie die verantwoordelijk is voor het opsporen en vervolgen van strafbare feiten. De belangrijkste rollen van de officier van Justitie zijn: 


het gezag voeren over onderzoeken van de politie;

bij zware misdrijven direct leiding geven aan onderzoeken van de politie; 

optreden als openbare aanklager in een rechtszaak (zie strafrecht); 

tijdens een rechtszaak een bepaalde straf eisen, die niet altijd door de rechter wordt opgelegd.
					Zowel de politie als de officier van Justitie kan dwangmiddelen toepassen. Bekende dwangmiddelen zijn bijvoorbeeld iemand fouilleren of vasthouden op het politiebureau.
De officier van Justitie bepaalt of hij een zaak aan de rechter wil voorleggen of niet. Hij moet er ook voor zorgen dat uitspraken van de strafrechter worden uitgevoerd.
De officier van Justitie moet zich aan strenge regels in de wet houden. De rechter controleert of de regels wel goed worden toegepast.

appraisal.p:
Ook is dit bestand nagekeken op zaken waarbij sprake was van:


zaken waarover politieke of maatschappelijke onrust bestond;

zaken die internationaal, landelijk, regionaal of lokaal ophef hebben veroorzaakt;

zaken waarbij belangrijke personen of instellingen betrokken waren;

zaken die van zodanig juridisch belang zijn dat de uitspraak gepubliceerd is in de daartoe bestaande jurisprudentieverzamelingen en vooraanstaande tijdschriften;

zaken die van belang zijn voor de rechtsontwikkeling.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
